public class Entry {
    public static void main(String[] args) {
        UrlRepo repo = new UrlRepo();
        ArrayList<URL> urls = new ArrayList<URL>();

        try {
            urls.add(new URL("https://en.wikipedia.org/wiki/Inverted_index"));
            urls.add(new URL("https://en.wikipedia.org/wiki/Napol%C3%A9on"));
            urls.add(new URL("https://en.wikipedia.org/wiki/Lebanon"));
        } catch (MalformedURLException e) {
            System.out.println("MalformedURLException");
        } finally {
            repo.receive(urls);
        }

        /*new Crawler(repo);*/


        Indexer i = new Indexer();

        try {
            i.index(new URL("https://en.wikipedia.org/wiki/Lebanon"));
            i.index(new URL("https://en.wikipedia.org/wiki/Napol%C3%A9on"));
            i.index(new URL("https://en.wikipedia.org/wiki/Inverted_index"));
            i.index(new URL("https://en.wikipedia.org/wiki/Rafic_Hariri"));
            i.index(new URL("https://en.wikipedia.org/wiki/Hezbollah"));
